from time import time


def performance_decorator(func):
    def wrap_func(*num):
        t1 = time()
        result = func(*num)
        t2 = time()
        print(f'func took {t2-t1}ms')
        # print(result)
        return result
    return wrap_func

""" search two numbers that have a sum of 0 """

@performance_decorator
def check_sum(li):
    count = 0
    for i in li:
        for j in li:
            count +=1
            if i + j == 0:
                return True
    print(f"first: {count}")
    return False

